#import "UIView+LayoutMethods.h"

@implementation UIView (LayoutMethods)

// coordinator getters
- (CGFloat)l_height
{
    return self.frame.size.height;
}

- (CGFloat)l_width
{
    return self.frame.size.width;
}

- (CGFloat)l_x
{
    return self.frame.origin.x;
}

- (void)setX:(CGFloat)x
{
    self.frame = CGRectMake(x, self.frame.origin.y, self.frame.size.width, self.frame.size.height);
}

- (void)setY:(CGFloat)y
{
    self.frame = CGRectMake(self.frame.origin.x, y, self.frame.size.width, self.frame.size.height);
}

- (CGFloat)l_y
{
    return self.frame.origin.y;
}

- (CGSize)l_size
{
    return self.frame.size;
}

- (CGPoint)l_origin
{
    return self.frame.origin;
}

- (CGFloat)l_centerX
{
    return self.center.x;
}

- (CGFloat)l_centerY
{
    return self.center.y;
}

- (CGFloat)l_bottom
{
    return self.frame.size.height + self.frame.origin.y;
}

- (CGFloat)l_right
{
    return self.frame.size.width + self.frame.origin.x;
}

// height
- (void)setHeight:(CGFloat)height
{
    CGRect newFrame = CGRectMake(self.l_x, self.l_y, self.l_width, height);
    self.frame = newFrame;
}

- (void)heightEqualToView:(UIView *)view
{
    self.height = view.l_height;
}

// width
- (void)setWidth:(CGFloat)width
{
    CGRect newFrame = CGRectMake(self.x, self.y, width, self.l_height);
    self.frame = newFrame;
}

- (void)widthEqualToView:(UIView *)view
{
    self.width = view.l_width;
}

// center
- (void)setCenterX:(CGFloat)centerX
{
    CGPoint center = CGPointMake(self.l_centerX, self.l_centerY);
    center.x = centerX;
    self.center = center;
}

